"use strict";var $jq=jQuery.noConflict();function wppfm_ftp_mode_changed(){wppfm_update_ftp_passive_mode($jq("#wppfm_ftp_passive_mode").is(":checked"),function(a){console.log(a)})}function wppfm_auto_feed_fix_changed(){wppfm_auto_feed_fix_mode($jq("#wppfm_auto_feed_fix_mode").is(":checked"),function(a){console.log(a)})}function wppfm_third_party_attributes_changed(){wppfm_change_third_party_attribute_keywords($jq("#wppfm_third_party_attr_keys").val(),function(a){console.log(a)})}function wppfm_backup(){if($jq("#wppfm_backup-file-name").val()!==""){$jq("#wppfm_backup-wrapper").hide();wppfm_initiateBackup($jq("#wppfm_backup-file-name").val(),function(a){wppfm_resetBackupsList();if(a!=="1"){wppfm_show_error_message(a)}})}else{alert("First enter a file name for the backup file.")}}function wppfm_deleteBackupFile(b){var a=confirm("Please confirm you want to delete backup "+b+".");if(a===true){wppfm_deleteBackup(b,function(c){wppfm_show_success_message(b+" removed.");wppfm_resetBackupsList();console.log(c)})}}function wppfm_restoreBackupFile(b){var a=confirm("Are you sure you want to restore backup "+b+"? This will overwrite the current Feed Manager data in the database!");if(a===true){wppfm_restoreBackup(b,function(c){if(c==="1"){wppfm_show_success_message(b+" restored");wppfm_resetOptionSettings()}else{wppfm_show_error_message(c)}})}}function wppfm_duplicateBackupFile(a){wppfm_duplicateBackup(a,function(b){if(b==="1"){wppfm_show_success_message(a+" duplicated")}else{wppfm_show_error_message(b)}wppfm_resetBackupsList()})}$jq(document).ready(function(){wppfm_listen()});